const messageChannel = new MessageChannel();
messageChannel.port1.onmessage = event => {
  console.log(event.data.streamItem);
  const secondChildStreamItem = window.document.getElementById('secondChildStreamItem');

  if (!secondChildStreamItem) {
    console.log("no secondChildStreamItem");
    const observer = new MutationObserver(function(mutations) {
      mutations.forEach(function(mutation) {
        if (!mutation.addedNodes) return

        for (var i = 0; i < mutation.addedNodes.length; i++) {
          const node = mutation.addedNodes[i];
          if (node.id == 'secondChildStreamItem') {
            node.insertAdjacentHTML('beforebegin', event.data.streamItem);
            this.disconnect();
            break;
          }
        }
      });
    });

    observer.observe(document, {
        childList: true,
        subtree: true,
        attributes: false,
        characterData: false,
    });
  } else {
    secondChildStreamItem.insertAdjacentHTML('beforebegin', event.data.streamItem);
  }

  window.caches.open('test-cache-v1').then(cache => {
    const images = window.document.getElementsByTagName('img');
    for (var i = 0; i < images.length; i++) {
      const imgRequest = new Request(images.item(i).src, {mode: 'no-cors'});
      fetch(imgRequest).then(imgResponse => cache.put(imgRequest, imgResponse));
    }
  });
}

if ('serviceWorker' in navigator) {
  window.addEventListener('load', function() {
    navigator.serviceWorker.register('/battlestar_demo_service_worker.js').then(function(registration) {
      // Registration was successful
      console.log('ServiceWorker registration successful with scope: ', registration.scope);
    }, function(err) {
      // registration failed :(
      console.log('ServiceWorker registration failed: ', err);
    });
  });

  console.log('navigator.serviceWorker', navigator.serviceWorker);
  navigator.serviceWorker.ready.then(registration => {
    registration.active.postMessage({msgType: 'SAVE_PORT'}, [messageChannel.port2]);
  });

  navigator.serviceWorker.ready.then(registration => {
    setTimeout(() => {
      registration.active.postMessage({msgType: 'UPDATE_CACHE', streamItem: continuePlayingStreamItem});
    }, 3000);
  });
}